tables.table_schema:
CREATE TABLE building_spaces (
    id UUID PRIMARY KEY,
    space_name VARCHAR(255),
    occupancy_status BOOLEAN,
    occupancy_capacity INTEGER
);

CREATE TABLE occupancy_log (
    log_id UUID PRIMARY KEY,
    space_id UUID,
    occupancy_status BOOLEAN,
    occupancy_timestamp TIMESTAMP
);

CREATE TABLE occupancy_data (
    space_id UUID PRIMARY KEY,
    occupancy_count INT,
    occupancy_timestamp TIMESTAMP
);

CREATE TABLE space_details (
    space_id UUID PRIMARY KEY,
    space_name VARCHAR,
    building_id UUID,
    floor_number INT
);

CREATE TABLE building_details (
    building_id UUID PRIMARY KEY,
    building_name VARCHAR,
    address VARCHAR
);

CREATE TABLE floor_details (
    floor_id UUID PRIMARY KEY,
    floor_number INT,
    building_id UUID
);

CREATE TABLE occupancy_logs (
   log_id INT PRIMARY KEY,
   space_id INT,
   occupancy_start TIMESTAMP,
   occupancy_end TIMESTAMP
);

CREATE TABLE occupancy_patterns (
   pattern_id INT PRIMARY KEY,
   space_id INT,
   pattern_description VARCHAR(255),
   observation_date DATE
);

CREATE TABLE efficiency_metrics (
   metric_id INT PRIMARY KEY,
   space_id INT,
   efficiency_score DECIMAL,
   evaluation_date DATE
);
